    let title ="Welcome to my website";
    let subTitle = "This is website is for learning react";
    
    const handleclick = () => {
        title = "Selamat Datang di Website Saya";
        console.log(title);
    }
    return (
        <div>
            <h2>{title}</h2>
            <h3>{subTitle}</h3>
            <button onClick={handleclick}>Click Me</button>
        </div>
    )
}
